_value'].concat(display_values);\n    new_data_line['display_date'] = new_data_line['display_date'].concat(display_dates);\n    new_data_line['Player'] = new_data_line['Player'].concat(Array(x_values.length).fill(selected_player));\n    new_data_line['Metric'] = new_data_line['Metric'].concat(Array(x_values.length).fill(selected_var));\n    new_data_line['color'] = new_data_line['color'].concat(Array(x_values.length).fill(lineColor));\n    new_data_line['Opponent'] = new_data_line['Opponent'].concat(opponents);\n    new_data_line['Result'] = new_data_line['Result'].concat(results);\n    new_data_line['Game'] = new_data_line['Game'].concat(games);\n}\n\nline_source.data = new_data_line;\nline_source.change.emit();\n\n// Update Bar Graph Data\nvar bar_data = all_data_bar['data'];\nfor (var i = 0; i &lt; bar_data.length; i++) {\n    if (all_data_bar['Metric'][i] == selected_var) {\n        new_data_bar['categories'].push(all_data_bar['categories'][i]);\n        new_data_bar['data'].push(bar_data[i]);\n        new_data_bar['Metric'].push(all_data_bar['Metric'][i]);\n    }\n}\n\nbar_source.data = new_data_bar;\nbar_source.change.emit();\n\n// Update Change Graph Data\nvar change_data = all_data_change['data'];\nfor (var i = 0; i &lt; change_data.length; i++) {\n    if (all_data_change['Metric'][i] == selected_var) {\n        new_data_change['categories'].push(all_data_change['categories'][i]);\n        new_data_change['data'].push(change_data[i]);\n        new_data_change['Metric'].push(all_data_change['Metric'][i]);\n    }\n}\n\nchange_source.data = new_data_change;\nchange_source.change.emit();\n"}}]]]},"options":["EFG%","3PT%","A2PT%","B2PT%","PPS","PPP","AST/TO","AST%","TO%","OREB/POSS","DREB/POSS","FT Rate","FT%","DEFL/POSS","EGBS/POSS","Paint%","Sprint%","Crash%","On-BallD%","TO F/Poss","Win%","AAL","Exertions"],"value":"EFG%"}},{"type":"object","name":"Div","id":"p1188","attributes":{"margin":[0,0,-20,5],"text":"&lt;h4&gt;Select a Player:&lt;/h4&gt;"}},{"id":"p118
